import React from 'react'
import {
    useHistory
} from 'react-router-dom';

const Navigation = () => {
    return (
        <div>
                <button className='searchButton'>Search</button>
                <input className='searchBar' placeholder="Search by Username" />
                <button>
                    <a href="/trending">
                        Trending
                    </a>
                </button>
                     
        </div>
    )
}

export default Navigation;
